import React from 'react'

const ListItems = () => {
    return (
        <tr>
            <th></th>
            <td>{idx}</td>
            <td>{productName}</td> {/* 정책명 */}
            <td>{guarantee}</td>{/* 보증 */}
            <td>{liog}</td>{/* 보증한도 */}
            <td>{termgnt}</td>{/* 보증기간 */}
            <td>제주</td>{/* 기업소재지 */}
            <td>제주신용보증재단</td>{/* 지원기간 */}
            <td>연 0.8% (고정)</td>{/* 이자율 */}
        </tr>
    )
}

export default ListItems
